import React, { useState } from 'react';
import { Upload, Button, message } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import axios from 'axios';

const VideoUpload = () => {
  const [loading, setLoading] = useState(false);

  const handleUpload = async (file) => {
    setLoading(true);
    const formData = new FormData();
    formData.append('file', file);
    formData.append('user_id', 1); // 假设用户ID为1

    try {
      const response = await axios.post('http://10.201.24.153:8000/api/videos/upload', formData);
      message.success('视频上传成功！');
    } catch (error) {
      message.error('视频上传失败，请重试！');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 300, margin: '0 auto', padding: '50px 0' }}>
      <h2>视频上传</h2>
      <Upload beforeUpload={handleUpload} showUploadList={false}>
        <Button icon={<UploadOutlined />} loading={loading} block>
          选择视频
        </Button>
      </Upload>
    </div>
  );
};

export default VideoUpload;
